// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Auction{
    address public highestBidder;
    uint public highestBid;
    address owner;
    address payable self = payable(address(this));


    constructor(){
        highestBid = 0;
        owner = msg.sender;
    }


    mapping(address => uint) public userBalances;


    modifier onlyBidder(){
        require(isnotOwner(msg.sender),"You are not a bidder");
        _;
    }

    function bid() public payable onlyBidder{

        require(msg.value > highestBid,"You have to raise");

        userBalances[msg.sender] = msg.value;

        highestBid = msg.value;

        highestBidder = msg.sender;

    }

    function withdraw() public onlyBidder{

        require(userBalances[msg.sender] < highestBid,"You cannnot withdraw because you are the highestBidder");


        require(payable(msg.sender).send(userBalances[msg.sender]),"Could not withdraw");

        userBalances[msg.sender] = 0;


    } 

    function getContractBalance() public view returns(uint){
        return self.balance;
    }


    function getBalance(address _user) public view returns(uint){
        return address(_user).balance;
    }

    function getBidderBids(address _bidder) public view returns(uint){
        return userBalances[_bidder];
    }

    function getHighestBidder() public view returns(address){
        return highestBidder;
    }

    function getHighestBid() public view returns(uint){
        return highestBid;
    }

    function isnotOwner(address _addr) public view returns(bool){
        return (_addr != owner);

    }

    receive() external payable{}
}
